import React from 'react';
import { BrowserRouter as Router, Link } from 'react-router-dom';
import AppRoutes from './router/routes';

function App() {
  return (
    <Router>
      <div>
        <h1>Welcome to the App</h1>
        <Link to="/popis-lovaca"><button>Popis lovaca</button></Link>
        <Link to="/raspored-aktivnosti"><button>Raspored</button></Link>
        <Link to="/Prisutnost"><button>Raspored</button></Link>
        <Link to="/popis-divljaci"><button>Popis divljaci</button></Link>
        <Link to="/unos-ostrjela"><button>Ostrjel</button></Link>
        <Link to="/popis-bodova"><button>Bodovi</button></Link>

        <AppRoutes />
      </div>
    </Router>
  );
}

export default App;
